function Test() {
  const vocab = [fetch('http://localhost/PWA-tutorial-training/learn-chinese/backend/index.php?lesson=flash')]
  const word = vocab.map(row => row.vid);
  return (
    <div className="App">
        chuck testa
        <ul>{word}</ul>
